export default class OptionModel{

    private _optionId:number;
    private _content:string;
    private _score:number;

    constructor(optionId:number,content:string,score:number){
        this._optionId = optionId;this._content=content;this._score = score
    }

    //getters setters
    get optionId():number{
        return this._optionId;
    }
    get content():string{
        return this._content;
    }
    
    get score():number{
        return this._score;
    }

    set optionId(optionId:number){
        this._optionId = optionId;
    }
    set content(content:string){
        this._content= content;
    }
    set score(score:number){
        this._score = score;
    }
}
